import React from 'react'
import styled from 'styled-components'

const Styles = styled.div``;

const ExperiencesPage = () => {
    return (
        <Styles>
            <div>
                <h4>EXPERIENCES PAGE</h4>
            </div>
        </Styles>
    )
}

export default ExperiencesPage
